private struct FfiConverterSequenceTypePocketVoiceInfo: FfiConverterRustBuffer {
    typealias SwiftType = [PocketVoiceInfo]

    static func write(_ value: [PocketVoiceInfo], into buf: inout [UInt8]) {
        let len = Int32(value.count)
        writeInt(&buf, len)
        for item in value {
            FfiConverterTypePocketVoiceInfo.write(item, into: &buf)
        }
    }

    static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> [PocketVoiceInfo] {
        let len: Int32 = try readInt(&buf)
        var seq = [PocketVoiceInfo]()
        seq.reserveCapacity(Int(len))
        for _ in 0 ..< len {
            try seq.append(FfiConverterTypePocketVoiceInfo.read(from: &buf))
        }
        return seq
    }
}

